window.bookSummaryJSON = "<p><b>Contains books one, two, and three of the Deliver series. </b></p> <p><i>Deliver</i>, book 1 </p> <p>She is a Deliverer. She lures young men and delivers them to be sold. She delivers the strikes that enforce their obedience. She delivers the training that determines their purchase price. As long as she delivers, the arrangement that protects her family will hold. The one thing she can't deliver is a captive from slavery. Until him. And her stubborn slave thinks he can deliver her...from herself. </p> <p><i>Vanquish</i>, book 2 </p> <p>Her life is like a self-made prison cell. Her agoraphobia doesn’t define her. It simply keeps her safe. He belongs in a prison cell. Capturing her is the easy part. Her f--ked-up mind, however, makes him question everything he does next. But he’s a determined bastard. If all goes his way, this will hurt like hell.</p> <p><i>Disclaim</i>, book 3</p> <p>Camila was 17 when Van Quiso kidnapped her. Ten years after her escape, the shackles refuse to release her. Not while there are still slave traders preying on her city. She will stop at nothing to end them. Even if that means becoming a slave again.</p>"; 
